{'input': 'How likely am I to find a snowy owl (Bubo scandiacus) in Comberton, Cambridgeshire', 'context': [Document(metadata={'source': 'data/retrieval_dossier/wikipedia-en-dwca-species-descriptions.csv'}, page_content='3583,"Snowy owl. Bubo scandiacus. Distribution and habitat. Breeding range The snowy owl is typically found in the northern circumpolar region, where it makes its summer home north of latitude 60° north though sometimes down to 55 degrees north. However, it is a particularly nomadic bird, and because population fluctuations in its prey species can force it to relocate, it has been known to breed at more southerly latitudes. Although the total breeding range includes a little over 12000000 km2, only about 1300000 km2 have a high probability of breeding, i.e. breeding at no more than 3–9-year intervals. Snowy owls nest in the Arctic tundra of the northernmost stretches of Alaska, Northern Canada, and Eurosiberia. Bobby Tulloch, the Shetland RSPB warden, at the site of the snowy owl nest on the island of Fetlar, Shetland, in August 1967<br/><br/>Between 1967 and 1975, snowy owls bred on the remote island of Fetlar in the Shetland Isles north of mainland Scotland, discovered by the'), Document(metadata={'source': 'data/retrieval_dossier/wikipedia-en-dwca-species-descriptions.csv'}, page_content='3588,"Snowy owl. Bubo scandiacus. Status. This species presence and numbers is dependent on amount of food available. In ""lemming years"", snowy owls can appear to be quite abundant in habitat. Numbers of snowy owls are difficult to estimate even within studies that take place over decades due to the nomadic nature of adults. The population of Scandinavia has long been perceived as very small and ephemeral with Finland holding 0–100 pairs; Norway holding 1–20 pairs and Sweden holding 1–50 pairs. A low breeding population within European Russia has been estimated to hold 1,300–4,500 pairs and Greenland to have 500–1,000 pairs.BirdLife International (2015). European Red List of Birds. Office for Official Publications of the European Communities, Luxembourg Other than northern part of the American continent, a majority of the snowy owl's breeding range is in northern Russia, but overall estimates are not known.Stepanyan, L.S. (1990). Konspekt ornitologicheskoi fauny SSSR. [Conspectus of'), Document(metadata={'source': 'data/retrieval_dossier/wikipedia-en-dwca-species-descriptions.csv'}, page_content='3580,"Snowy owl. Bubo scandiacus. Abstract. The snowy owl (Bubo scandiacus), also known as the polar owl, the white owl and the Arctic owl, is a large, white, owl of the true owl family. Snowy owls are native to the Arctic regions of both North America and the Palearctic, breeding mostly on the tundra. It has a number of unique adaptations to its habitat and lifestyle, which are quite distinct from other extant owls. One of the largest species of owl, it is the only owl with largely white plumage. Males tend to be a purer white overall while females tend to more have more extensive flecks of dark brown.Holt, D. W., M. D. Larson, N. Smith, D. L. Evans, and D. F. Parmelee (2020). Snowy Owl (Bubo scandiacus), version 1.0. In Birds of the World (S. M. Billerman, Editor). Cornell Lab of Ornithology, Ithaca, NY, USA. Juvenile male snowy owls have dark markings that may appear similar to females until maturity, at which point they typically turn whiter. The composition of brown markings'), Document(metadata={'source': 'data/retrieval_dossier/wikipedia-en-dwca-species-descriptions.csv'}, page_content='3582,"Snowy owl. Bubo scandiacus. Description. A captive adult male.<br/><br/>The snowy owl is mostly white. They are purer white than predatory mammals like polar bears (Ursus maritimus) and Arctic fox (Vulpes lagopus). Often when seen in the field, these owls can resemble a pale rock or a lump of snow on the ground. It usually appears to lack ear tufts but very short (and probably vestigial) tufts can be erected in some situations, perhaps most frequently by the female when she is sitting on the nest. The ear tufts measure about 20 to and consist of about 10 small feathers. The snowy owl has bright yellow eyes. The head is relatively small and, even for the relatively simply adapted hearing mechanism of a Bubo owl, the facial disc is shallow and the ear is uncomplicated. 1 male had ear slits of merely 21 x on left and 21 x on the right. Females are almost invariably more duskily patterned than like-age males. In mature males, the upper parts are plain white with usually a few dark')], 'answer': 'The likelihood of finding a snowy owl (Bubo scandiacus) in Comberton, Cambridgeshire, is extremely low. Snowy owls are typically native to the Arctic regions and are most commonly found in the northern circumpolar region. Their breeding range is generally north of latitude 60° north, although they can occasionally be found as far south as 55° north during breeding seasons under certain conditions. 

Comberton, Cambridgeshire, is located much farther south, at approximately 52° north latitude, which is outside of their usual range. However, snowy owls are known to be nomadic, and their movements are often influenced by prey availability, particularly lemming populations. In rare instances, during "irruption" years when prey populations in the Arctic decline dramatically, snowy owls can migrate much farther south than usual in search of food.

While there have been rare sightings of snowy owls in various parts of the UK during such irruptions, these are exceptional and not common. Therefore, while not entirely impossible, it would be highly unusual to encounter a snowy owl in Comberton, Cambridgeshire.'}

